function LoggedNavButtonFunc(){
        <>
                return(
                <h1 to="/" className="navbar-title-class"> InstaClone </h1>
                    <nav className="navigation-class">
                    <Link to="/" className='navigation-button-class'>홈</Link>
                    <Link to="/about" className='navigation-button-class'>탐색</Link>
                    <Link to="/contact" className='navigation-button-class'>업로드</Link>
                    <Link to="/about" className='navigation-button-class'>알림</Link>
                    <Link to="/contact" className='navigation-button-class'>메시지</Link>
                    <Link to="/contact" className='navigation-button-class'>로그아웃</Link>
                    </nav>
                )
        </>
}

export default NavBar;
